import './App.css';
import { motion } from "framer-motion";
import * as PropTypes from "prop-types";
import Hero from "./components/Hero";


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Hero />
        <ProjectTable />
        <ExperienceTable />
        <AboutMe />
      </header>
    </div>
  );
}

function TitleCard(props) {
  return (
    <h1>{props.title}</h1>
  )
}


function ProjectTable() {
  const projectItem = projects.map(project =>
    <ProjectDisplay project={project} />
  )

  return (
    <div className="ProjectTable">
      <TitleCard title={"Projects"} />
      {projectItem}
    </div>
  );
}

function ProjectDisplay({project}) {
  return (
    <div className="ProjectDisplay">
      <h5>{project.name}</h5>
      <p>{project.desc}</p>
    </div>
  )
}

function ExperienceTable() {
  const experienceItem = experience.map(job =>
    <ExperinceDisplay job={job} />
  )
  return (
    <div className="ExperienceTable">
      <h2>Experience</h2>
      {experienceItem}
    </div>
  )
}

function ExperinceDisplay({job}) {
  return (
    <div className="ExperienceDisplay">
      <h5>{job.name}</h5>
    </div>
  )
}

function AboutMe() {
  return (
    <div className="AboutMe">
      <h2>About Me</h2>
      <h5>Socials:</h5>
      <p>Instagram</p>
      <p>Facebook</p>
      <p>LinkedIn</p>
      <p>Spotify</p>
    </div>
  )
}

const projects = [
    {name: "Stat Tracker", desc: "Application made in python to add statistic information and show them on graphics."},
    {name: "Space Pew", desc: "Pygame application with score progression, lives, and power ups."}
]

const experience = [
  {name: "Amazon", desc: ""},
  {name: "Assure-US", desc: ""}
]

export default App;
